import io from 'socket.io-client';

const socket = io.connect("http://localhost:3001")

function App() {

  const send_message = () => {
    socket.emit(send_message, {message: "Hello"});
  };

  socket.on

  return (
    <div>
      <h1>Messages</h1>
      <input placeholder='Message..' />
      <button onClick={send_message}>SEND</button>
    </div>
  );
}

export default App;
